window.bookSummaryJSON = "<p><b>On this episode of WAGS...</b></p> <p>Aspiring hairstylist, Logan Taylor, has put her dreams on hold to see her sister through school, per her parents' last wishes. Stressed and working two jobs—barely making ends meet and on the brink of burnout, she's faced with no other choice; get another job and hope things let up… soon.</p> <p>Khamari Coleman is in Lavendale to enjoy All-Star weekend—the first of his career, connecting with old friends and hopefully, procuring a new home to further his life in basketball. What he wasn't expecting was to be smitten by a doe-eyed beauty with an air of mystery around her.</p> <p>After days of being spun in her web, Khamari wants nothing more than to be in her space as long as time will allow. Logan is trying to put her life together and ignore what she wants and needs for herself. Can one weekend be the key to finding herself again or will bliss only last for the weekend?</p> <p>Tune in!</p>"; 
